Hong Kong: técnicas dos manifestantes para combater o efeito do gás lacrimogêneo, balas de borracha e gás de pimenta utilizadas pela polícia.

Máscara para os olhos ou óculos de natação;
Máscara de gás;
Capacete;
Soro fisiológico para lavar os olhos;
Luvas à prova de fogo para agarrar as granadas incandescentes de gás lacrimogêneo lançadas pela polícia;
Tampas e panelas para apagar os gases;
Cones de trânsito para se defender do gás lacrimogêneo;
Garrafas de água jogadas no cone para apagar a granada;
Papel celofone enrolado ao redor dos braços e pernas para evitar as irritações provocadas pelo gás lacrimogêneo;
Guarda-chuva contra as balas de borracha e o gás de pimenta.

É só questão de tempo até a polícia reagir contra a população pacífica. Repassem.

